"use strict";

const ObjectStoreError = require("./objectstore-error.js");

class DuplicateKey extends ObjectStoreError {
  constructor(cause, message) {
    super(message || "UuObject attributes violate index uniqueness.", cause);
    this.code = `${ObjectStoreError.ERROR_PREFIX}duplicateKey`;
  }
}

module.exports = DuplicateKey;
